const RestaurantMenu = () =>{
  return(
    <div className="menu">
     <h1>Name of Restaurant</h1>
     <h2>Menu</h2>
     <ul>
        <li>Biryani</li>
        <li>Burger</li>
        <li>Diet Coke</li>
     </ul>
    </div>
  );
};

export default RestaurantMenu;
